import React from 'react';
import classes from './TimingSlider.module.css';
import { Slider } from '@mui/material';

export default function TimingSlider() {
  let timing;

  const handleChange = (event) => {
    timing = event.target.value;
  };
  return (
    <div>
      <Slider
        className={classes.slider}
        aria-label="Volume"
        value={timing}
        onChange={handleChange}
        size="small"
        color="success"
        sx={{
          color: 'white',
          width: 100,
          height: 5,
          '& .MuiSlider-thumb': {
            color: 'transparent',
          },
          '& .MuiSlider-thumb:hover': {
            color: 'white',
          },
          '& .MuiSlider-thumb:active': {
            color: 'white',
          },
          '& .MuiSlider-rail': {
            color: 'white',
          },
        }}
      />
    </div>
  );
}
